import React, { useEffect, useState } from "react";
import axios from "axios";
import { useNavigate } from "react-router-dom";

const Checkout = () => {
  const [formData, setFormData] = useState({
    name: "",
    phoneNumber: "",
    address: "",
    pincode: "",
    landmark: "",
  });

  const [cart, setCart] = useState(() => {
    return JSON.parse(localStorage.getItem("cart")) || [];
  });

  // Store cart details
  const [totalPrice, setTotalPrice] = useState(0);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    const fetchCart = async () => {
      try {
        const token = localStorage.getItem("token");
        const response = await axios.get("http://localhost:7001/api/cart/get", {
          headers: { Authorization: `Bearer ${token}` },
        });

        /* eslint-disable */console.log(...oo_oo(`3191634827_31_8_31_56_4`,"Cart API Response:", response.data)); // Debugging log

        setCart(response.data.cart);
        setTotalPrice(response.data.totalPrice);
      } catch (err) {
        /* eslint-disable */console.error(...oo_tx(`3191634827_36_8_36_50_11`,"Error fetching cart:", err));
        setError("Failed to load cart. Please try again.");
      }
    };

    fetchCart();
  }, []);

  // Handle input changes
